import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

import './App.css';
import Topmenu from './components/TopMeu';
import LoginPage from './pages/login.page';

function App() {
  return (
    <Router>
      <div className="App">
      <Topmenu />
      </div>

      <Switch>
        <Route path='/login' exact component={LoginPage} />
      </Switch>
    </Router>
  );
}

export default App;
